Яркие аппетитные овощи, изображённые на фотообоях «Овощное ассорти», поднимают настроение и пробуждают аппетит. Такие фотоОбои станут украшением любой кухни, помогут создать в помещении уютную атмосферу и при необходимости разделить пространство на функциональные зоны.
